/*
interface qParamObject {
    name: string[],
    range: boolean[],
    array: boolean[],
}

export const qParamObject = {
    name: ["title","type","created","tag"],
    range: [false, false, true, false],
    array: [false, false, false, true],
}*/

interface qParamObject {
    name: string,
    range: boolean,
    array: boolean,
}

interface qParamArray {
    fields: qParamObject[]
}

export const qParamArray = {
    fields:
    [
        {
            name: "title",
            range: false,
            array: false,
        },
        {
            name: "type",
            range: false,
            array: false,
        },
        {
            name: "created",
            range: true,
            array: false,
        },
        {
            name: "tag",
            range: false,
            array: true,
        },
    ]
}
